import logo from './logo.svg';
import './App.css';
import {createBrowserRouter, RouterProvider} from "react-router-dom"
import Home from './Components/Home';
import Login from './Components/Login';
import Signup from './Components/Signup';
import RoutesProtect from './RoutesProtect/RoutesProtect';
import AuthContextProvider from './Components/context/AuthContext';
import ProtectDataRoutes from './RoutesProtect/ProtectDataRoutes';

function App() {
  const router = createBrowserRouter([{
    path:'/' , element: <RoutesProtect> <Home /> </RoutesProtect>
  } , {    path:"Login" , element :<ProtectDataRoutes><Login /></ProtectDataRoutes>  ,
   } , { path:"Signup" , element :<ProtectDataRoutes><Signup /></ProtectDataRoutes> }])
  return (
    <>
<AuthContextProvider>
  <RouterProvider router={router} />
</AuthContextProvider>

    </>
  );
}

export default App;
